const appMatch = resolve => {
  import('./match').then(module => {
    resolve(module)
  })
}
const appWebPage = resolve => {
  import('./webPage').then(module => {
    resolve(module)
  })
}
const appClone = resolve => {
  import('./clone').then(module => {
    resolve(module)
  })
}
const downloadApp = resolve => {
  import('./downloadApp').then(module => {
    resolve(module)
  })
}
const appRegister = resolve => {
  import('./appRegister').then(module => {
    resolve(module)
  })
}
export default [{
    name: 'appMatch',
    path: '/app/match',
    component: appMatch,
    meta: {
      title: '',
      nav: false,
      auth: false,
      keepAlive: false
    }
  },
  {
    name: 'appWebPage',
    path: '/app/webPage/:id',
    component: appWebPage,
    meta: {
      title: '',
      nav: false,
      auth: false,
      keepAlive: false
    }
  },
  {
    name: 'appClone',
    path: '/app/clone/:id',
    component: appClone,
    meta: {
      title: '',
      nav: false,
      auth: true,
      keepAlive: true
    }
  },
  {
    path: '/app/download',
    component: downloadApp,
    meta: {
      nav: false,
      auth: false,
      keepAlive: false,
      title: '下载汇脉宝App'
    }
  }, {
    path: '/app/register',
    component: appRegister,
    meta: {
      nav: false,
      auth: false,
      keepAlive: false,
      title: '注册'
    }
  }
]
